<div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Siena Wind Orchestra</div><div class="time">4:30 pm</div><div class="location">Japan  Tokyo -</div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">03</div><div class="month">May</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Amicitia Landsmeer</div><div class="time">2:00 pm</div><div class="location">The Netherlands  Amsterdam -</div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">16</div><div class="month">May</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Banda y Coro del Conservatorio Profesional de Salamanca</div><div class="time">8:00 pm</div><div class="location">Spain  Salamanca - </div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">13</div><div class="month">May</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Wind Orchestra NAGOYA 2020</div><div class="time">3:00 pm</div><div class="location">Japan  Nagoya -</div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">05</div><div class="month">May</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Kyushu Wind Orchestra</div><div class="time">2:00 pm</div><div class="location">Japan  Fukuoka, Kyushu - </div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">10</div><div class="month">May</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Kyushu Wind Orchestra</div><div class="time">3:00 pm</div><div class="location">Japan  Fukuoka, Kyushu -</div></div