"year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Chesapeake Bay Wind Ensemble</div><div class="time">8:00 pm</div><div class="location">USA  Newport News, Virginia -</div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">06</div><div class="month">June</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Bue Ciel Symphonic Winds</div><div class="time">2:00 pm</div><div class="location">Japan  Osaka -</div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">14</div><div class="month">June</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Wind Orchestra Kazenowa </div><div class="time">2:00 pm</div><div class="location">Japan  Tokyo -</div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">14</div><div class="month">June</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Akikazu Toita trombone, Makiko Miura piano</div><div class="time">7:00 pm</div><div class="location">Japan  Osaka -</div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">24</div><div class="month">June</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Allentown Band</div><div class="time">7:30 pm</div><div class="location">USA  Allentown, PA</div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">02</div><div class="month">July</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">Osaka Concert Brass </div><div class="time">7:00 pm</div><div class="location">Japan  Osaka -</div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">03</div><div class="month">July</div><div class="year">2020</div></div></div></div><div class="agenda-list row"><div class="agenda-info col-lg-11 col-md-10"><div><div class="title">LBM Jeugdorkest</div><div class="time">8:00 pm</div><div class="location">The Netherlands  Landgraaf - </div></div></div><div class="date col-lg-1 col-md-2"><div><div class="day">04</div><div class="month">July</div><div class="year">2020</div></div></div></div></div></section>
    </>)
}
function mapStateToProps(state) {
    return {
        agendas:state.agendaReducer
    };
  }

  function mapDispatchToProps(dispatch) {
    return {
      actions: bindActionCreators(
        {
            mainAction
        },
        dispatch
      )
    };
  }

  export default connect(
    mapStateToProps,
    mapDispatchToProps
  )(Agenda);
